using System;
using System.Collections.Generic;
using System.Text.RegularExpressions;
					
public class Program
{
	public class Settings{
		public int volume = 2;
	};
	
	public static Settings settings = new Settings();
	
	public static Dictionary<string, Dictionary<string, string>> IniFileData = new Dictionary<string, Dictionary<string, string>>();
	
	public static bool LoadSetting(string settingValue, ref object settingToSet, Type settingType)
	{
		bool status = false;
		
		if(settingType == typeof(int)) {
			int valueToSet = -1;
			if(status = Int32.TryParse(settingValue, out valueToSet)) settingToSet = valueToSet;
		}
		
		return status;
	}
	
	public static void CompileIniFileData(string data){
		Regex rxHeader = new Regex(@"\[[a-zA-Z\s]*\]");
		Regex rxHeaderWithData = new Regex(@"\[[a-zA-Z\s]*\]([a-zA-Z0-9 \t\r(\n|$)=]*)");
		Regex rxComment = new Regex(@"(#[a-zA-Z0-9 \t]*)(\n|$)*");
		Regex rxValueLine = new Regex(@"[a-zA-Z0-9]+[a-zA-Z0-9 \t]*=[a-zA-Z0-9 \t]+(\n|$)");
		Regex rxRemoveTrailingWhiteSpaces = new Regex(@"[ \t]+(\r*\n|$)");
		Regex rxValueKeySplitter = new Regex(@"[ \t]*=[ \t]*");
		
		data = rxComment.Replace(data, "");
		
		foreach(Match m in rxHeaderWithData.Matches(data))
		{
			//Console.WriteLine("line: {0}", m.Value);
			string header = "";
			string segmentData = m.Value;
			Dictionary<string, string> valueData = new Dictionary<string, string>();
			foreach(Match mHeader in rxHeader.Matches(segmentData))
			{
				segmentData = segmentData.Remove(mHeader.Index, mHeader.Length);
				header = Regex.Replace(mHeader.Value, @"\[?\]?", "");
			}
			foreach(Match mValueKeyCombination in rxValueLine.Matches(segmentData))
			{
				string valueKeyComination = rxRemoveTrailingWhiteSpaces.Replace(mValueKeyCombination.Value, "");
				string[] valueWithKey = rxValueKeySplitter.Split(valueKeyComination);
				valueData.Add(valueWithKey[0], valueWithKey[1]);
			}
			
			IniFileData.Add(header,valueData); //this is not additive
			Console.WriteLine("header '{0}': added {1} key-value combinations", header, valueData.Count);
		}
	}
	
	public static void Main()
	{
		string data = @"[Settings]
				#master audio volume
				volume = 1
				
				[Display] #1080p default
				width = 1920
				height = 1080     
				
				[Extra]
				comment = this is weird data
			";
		
		//init ini file data
		CompileIniFileData(data);

		//load [Settings]
		Console.WriteLine("value of volume setting before loading is: {0}", settings.volume);
		Dictionary<string, string> settings_data;
		if(IniFileData.TryGetValue("Settings", out settings_data))
		{
			
			
			object refObj = null;
			//volume
			string strVolumeValue;
			if(settings_data.TryGetValue("volume", out strVolumeValue))
				if(LoadSetting(strVolumeValue, ref refObj, settings.volume.GetType()))
					settings.volume = (int) refObj;
		}
		
		Console.WriteLine("value of volume setting is: {0}", settings.volume);
		
		//load [Display]
		//....
	}
}

