func searchMatrix(matrix [][]int, target int) bool {
    if len(matrix) == 0 {
        return false
    }
    m, n := len(matrix), len(matrix[0])
    left, right := 0, m*n-1

    for left <= right {
        mid := left + (right-left)/2
        mid_row := mid / n
        mid_col := mid - mid_row*n

        if matrix[mid_row][mid_col] == target {
            return true
        } else if matrix[mid_row][mid_col] < target {
            left = mid + 1
        } else {
            right = mid - 1
        }
    }
    return false
}

func maxArea(height []int) int {
    res :=0

    l,r:=0,len(height)-1

    for l<r {
        area:= (r-l) * min(height[l],height[r])
        res = max(res,area)
        if height[l] < height[r] {
            l++
        }else {
            r--
        }
    }
    return res
}

func min(r,l int) int {
    if r < l {
        return r
    }
    return l
}
func max(r,l int) int {
    if r > l {
        return r
    }
    return l
}

def team_lineup(*players):
    countries = {}
    for player, country in players:
        countries.setdefault(country,[])
        countries[country].append(player)
    countries = sorted(countries.items(), key=lambda x: (-len(x[1]),x[0]))
    # res = [f"{country}:\n{'\n'.join(f'''  -{player}''' for player in players)}" for country,players in countries]
    res = []
    for country,players in countries:
        res.append(f"{country}:")
        res.append('\n'.join(f'''  -{player}''' for player in players))

    return '\n'.join(res)

