void solve()
{
    int n;
    cin >> n;
    vector<int> v(n);
    for (int i = 0; i < n; i++)
    {
        cin >> v[i];
    }
    int ans = 0;
    for (int i = 0; i < n - 1; i++)
    {
        int f = min(v[i], v[i + 1]);
        int s = max(v[i], v[i + 1]);
        ans += (f ^ s);
        for (int j = i + 2; j < n; j++)
        {
            if (v[j] <= f)
            {
                s = f;
                f = v[j];
            }
            else if (v[j] >= f && v[j] <= s)
                s = v[j];
            ans += (f ^ s);
        }
    }
    cout << ans << endl;
}

signed main()
{
    fast();
    int t = 1;
    cin >> t;
    while (t--)
    {
        solve();
    }
    return 0;
}

