	BigInteger& operator + (const BigInteger& other) const {
	    bool is_negative = false;
		if (is_negative_ && other.is_negative_) {
		    is_negative = true;
		}
		else if (is_negative_)
		{
		    return other - *this;
		}
		else if (other.is_negative_)
		{
		    return *this - other;
		}
		
		size_t max_length = std::max(length_, other.length_);
		size_t i = 0;
		char overflow = 0;
		BigInteger* res = new BigInteger();
		res->num_.clear();
		while (i < max_length)
		{
		    char digit1 = i >= length_ ? 0 : num_[i];
		    char digit2 = i >= other.length_ ? 0 : other.num_[i];
		    res->num_.push_back((digit1 + digit2 + overflow) % 10);
		    overflow = (digit1 + digit2 + overflow) / 10;
		    ++i;
		    
		}
		if (overflow > 0)
		{
		    res->num_.push_back(overflow);
		}
		res->length_ = res->num_.size();
        res->is_negative_ = is_negative;
		return *res;
	}

